import React from "react";
import "./Codes.css";

const build = (props) => (
<section id="codes">
<div className="codes-detail"> {
props.link !== "N/A" ? (
<a href="{props.link}" rel="">
<i className="fa-solid fa-arrow-right arrow"/>
</a>
) : <span/>
}
<i className="fa-regular fa-arrow-up-right"/>
<img src="{props.image}" alt="" />
<div className="label">
<h3>{props.name}</h3>
<p>{props.description}</p>
<div className="labels"> {
props.box.map((stack, id) => (
<button key={id}>
{stack}
</button>
))
}
  </div>
 </div>
</div>
</section>
);

export default build;
